import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import routes from './router'
import reportWebVitals from './reportWebVitals';
import { useRoutes } from "hookrouter";


class Renders extends Component {
  state = {routesList : ["route1", "route2"]};

  addRoute = (route, category) => {
    console.log(this.state.routesList)
    this.setState(previousState => ({
      routesList: [...previousState.routesList, route]
  }));
  }

  makeRoutes = () => {
    const routesJSX = useRoutes(routes);
    return (routesJSX)
  }

  render() {  
    return(<React.StrictMode>
      {this.state.routesList.map((routePoint) => <p>{routePoint}</p>)}
        <makeRoutes/>
      </React.StrictMode>)
  }
};

ReactDOM.render(
  <Renders/>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
